const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h2 {...{
      "id": "q-how-is-amazon-sqs-different-from-amazon-sns"
    }}>{`Q: How is Amazon SQS different from Amazon SNS?`}</h2>
    <p>{`Amazon SNS allows applications to send time-critical messages to multiple subscribers through a “push” mechanism, eliminating the need to periodically check or “poll” for updates. Amazon SQS is a message queue service used by distributed applications to exchange messages through a polling model, and can be used to decouple sending and receiving components. `}</p>
    <h2 {...{
      "id": "q-does-amazon-sqs-provide-message-ordering"
    }}>{`Q: Does Amazon SQS provide message ordering?`}</h2>
    <p><strong parentName="p">{`Yes`}</strong>{`. FIFO (first-in-first-out) queues preserve the exact order in which messages are sent and received. If you use a FIFO queue, you don't have to place sequencing information in your messages. For more information, see FIFO Queue Logic in the Amazon SQS Developer Guide.`}</p>
    <p>{`Standard queues provide a loose-FIFO capability that attempts to preserve the order of messages. However, because standard queues are designed to be massively scalable using a highly distributed architecture, receiving messages in the exact order they are sent is not guaranteed.`}</p>
    <h2 {...{
      "id": "q-does-amazon-sqs-guarantee-delivery-of-messages"
    }}>{`Q: Does Amazon SQS guarantee delivery of messages?`}</h2>
    <p>{`Standard queues provide at-least-once delivery, which means that each message is delivered at least once.`}</p>
    <p>{`FIFO queues provide exactly-once processing, which means that each message is delivered once and remains available until a consumer processes it and deletes it. Duplicates are not introduced into the queue.`}</p>
    <h2 {...{
      "id": "q-how-is-amazon-sqs-different-from-amazon-kinesis-streams"
    }}>{`Q: How is Amazon SQS different from Amazon Kinesis Streams?`}</h2>
    <p>{`Amazon SQS offers a reliable, highly-scalable hosted queue for storing messages as they travel between applications or microservices. It moves data between distributed application components and helps you decouple these components. Amazon SQS provides common middleware constructs such as dead-letter queues and poison-pill management. It also provides a generic web services API and can be accessed by any programming language that the AWS SDK supports. Amazon SQS supports both standard and FIFO queues.`}</p>
    <p><a parentName="p" {...{
        "href": "aks"
      }}>{`Amazon Kinesis Streams`}</a>{` allows real-time processing of streaming big data and the ability to read and replay records to multiple Amazon Kinesis Applications. The Amazon Kinesis Client Library (KCL) delivers all records for a given partition key to the same record processor, making it easier to build multiple applications that read from the same Amazon Kinesis stream (for example, to perform counting, aggregation, and filtering).`}</p>
    <h2 {...{
      "id": "fifo-queues"
    }}>{`FIFO queues`}</h2>
    <h3 {...{
      "id": "q-how-many-copies-of-a-message-will-i-receive"
    }}>{`Q: How many copies of a message will I receive?`}</h3>
    <p>{`FIFO queues are designed to never introduce duplicate messages. However, your message producer might introduce duplicates in certain scenarios: for example, if the producer sends a message, does not receive a response, and then resends the same message. Amazon SQS APIs provide deduplication functionality that prevents your message producer from sending duplicates. Any duplicates introduced by the message producer are removed within a 5-minute deduplication interval.`}</p>
    <p>{`For standard queues, you might occasionally receive a duplicate copy of a message (at-least-once delivery). If you use a standard queue, you must design your applications to be idempotent (that is, they must not be affected adversely when processing the same message more than once).`}</p>
    <h2 {...{
      "id": "q-will-i-be-able-to-view-instance-usage-against-these-limits"
    }}>{`Q: Will I be able to view instance usage against these limits?`}</h2>
    <p>{`With the Amazon CloudWatch metrics integration, you can view EC2 usage against limits in the Service Quotas console.`}</p>
    </MDXLayout>;
}

;
